import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { SpeedSlalomBasic } from '../Model/Interface';

const host = 'localhost:3001';
interface Props {
    speedSlalomRecords: SpeedSlalomBasic[];
}

const AnalyzeSSR = () => {
    const [SSRecords, setSSRecords] = useState<SpeedSlalomBasic[]>([]);
    const [athletesData, setAthletesData] = useState<Record<string, any>>({});


    useEffect(() => {
        axios.get('http://your-backend-url/api/getSSRecords')
            .then(response => {
                setSSRecords(response.data);
            })
            .catch(error => {
                console.error(error);
            });
    }, []);
    return (
        <div>

        </div>
    );
}

export default AnalyzeSSR;
